CREATE PROCEDURE [dbo].[sp_delete_Order]
    @order_id INT,
    @Success INT OUTPUT
AS

 BEGIN 
      SET nocount ON
      SET TRANSACTION isolation level READ uncommitted

      INSERT INTO  [dbo].[Order]
      VALUES      (
	                NEWID(),  
                    @productName,
                    @categoryId,
                    @orderDate,
                    @isProductRecieve,
					@EntryDateTime,
					@EntryBy,
					'Active')

      SET @orderId = Scope_identity();
      SELECT @orderId orderId
  END

